Photo by @sinnaevephotos / This is a moment shared with Samuel Jung (@samjung_1). At the time, Samuel was a new face at Soul Artist Management (@soulartistmgmt), so the idea of photographing him with a fresh flower seemed fitting. 

I believe the way we see the world is a product of our environment and experiences. When I look back at this portrait, I can’t help but acknowledge the influence artists who came before me have had on my work…Mapplethorpe Flora: The Complete Flowers book, Richard Avedon’s (@avedonfoundation) portrait of Uma Thurman (@umathurman) with a dove, and the countless faces that have graced the covers of i-D Magazine (@i_d) with one eye closed/covered gave rise to this portrait of Samuel.

