Tucker Des Lauriers (@tsdeslauriers) with Soul Artist Management (@soulartistmgmt) for Bailey Hats (@bailey_hats). For this project, Tucker and I drove upstate to Millbrook, New York, a one-stoplight village in the heart of horse country. 

Shooting this project brought me back to a much different time in my life growing up in Michigan. A time when my friends and I would throw on our boots and flannels, buy a case of beer, enjoy the warmth of a bonfire under a sky full of stars, and run like hell when the cops showed up. What a rush!

